import React from "react";
import "./Skills.css";

const Skills = () =>{
    return(
       <section id="skills">
        <span className="skillTitle">What to do</span>
        <span className="skillDesc">I am a skilled and pationate web designer with experience in front end languages. I am recently working on react now a days.</span>

       </section>
    )
}

export default Skills;
